(2, 'example@example.com', 'vergil', '001278530795143', NULL, 'Анимешники как вы З....и со своей галимой Восточно-Японско-Узкоглазой  культурой и глубоким филосовским смыслом. Вы распладились как кролики и  ходите зачесываясь и красясь под очередного идиота из очередного сериала\nВы  как стадо где травка сочнее туда и прете!!! (в данном случае где  красивше, ярче, больше приколов и экшена вам глубоко посрать на  «Филосовский смысл».)\nБольшинство из вас перечислит на память имена  всех героев с трудно произносимым названием. Но никто не знает имен  героев Великой Отечественной, стихи Пушкина или произведения  Достоевского? (что достойно сохраниться в памяти подумайте!!!).\nЧему  тебя научил Твой Гребанный 500 серийный Наруто или Блич???? многому???  (ни П...И и это хорор и экшен как и амерекосовские боевики). Вспомним  советские мультики.... Вспомнили??? чему они учат??? Даже взрослому  человеку есть чему научиться. Вас Анимешников уймовая толпа народу,  большинство из вас талантливые ребята. Так почему вы покланяетьсь аниме и  обмусливаете очередную серию Наруто?? Вы забиваете свои мозг Чужой  Филосовией и стилем жизни!!! Отвергая и убивая свои родное.\nP.S. Я ни  чего не имею против японцев или китайцев, у них свои тараканы в голове.  Просто задолбало в школе, универе, с друзьями АНИМЕ,  АНИМЕ,АНИМЕ,АНИМЕ,АНИМЕ,АНИМЕ,АНИМЕ,АНИМЕ. Блин народ вы совсем с дуба  рухноли???? Идете как стадо за очередной агиткой. То все фанатели от  америкосовских фильмов, теперь претесь от японских мультиков. Реально  как стадо=,В. Просто потеряли способность смотреть трезвым взглядом на  вещи.\nРебята воины ведуться не только на поле брани и за территорию,  воины идут в культуре за умы и души. Если мы также и дальше будем идти  за пряником то в конце-концов придем в утопию:\nСидит перед  телевизором огромная 200 килограммовая туша жрет хотдог и запивает  колой. Попутно ковыряется в интернете на порно сайте или зыркает аниме  (в большинстве своём одно и тоже). Это фригидно-бесполое существо, у  которого нет ни семьи (так как ни одна девушка (парень) ни была похожа  на анимешную красавицу (красавца)), ни детей. Он не видет красоты за  окном, поэзия и тяга к прекрасному-:-D :-D :-D :-D не это не для нашего  героя. Слишком трудно. Ему нуна что нить по проще где уже все переварино  и прожованно. Вот кто такие анимешники и к чему они идут. Огромны  респект вам. В том же духе и дальше.'),
