(2, 'example@example.com', 'LbISS', '001283712853133', NULL, '12-летний норвежец Ганс Йорген Ольсен прогуливался с сестрой по лесу близ города Лексвик. Внезапно им на пути попался рассерженный лось. Но Ганс не растерялся, а подразнил лося, чтобы отвлечь его от сестры. Как он объяснил позже, в игре World of Warcraft сильные игроки дразнят монстров, чтобы отвлечь их от слабых товарищей по команде. \n\nЖивотное пошло за ним, тогда он притворился мертвым. «Когда достигаешь 30 уровня в WoW, узнаешь трюк «мнимая смерть», — рассказывает Ганс. — Я притворился мертвым, и лось потерял ко мне интерес». \n\nСудя по тому, что трюк удался, мальчуган уже достиг 30 уровня. В этой истории осталось неясным только одно: получил ли он за свой подвиг квестовую награду. \n\nПользуясь случаем, «Смена» предлагает компании Blizzard (производителю WoW) открыть на своих серверах курсы повышения квалификации для лесников.\n'),
